# Formats prénoms composés :
# jeude
# jeang
# jean_eude
# jean-eude
# je

def fname_variants():
    global fname
    global separators
    res = []
    if(fname is None):
        return res
    else:
        res.append(fname)
    if('-' in fname):
        f = fname.split('-')
        res = [f[0][0]+f[1], f[0]+f[1][0], fname, f[0][0]+f[1][0]]
        for sep in separators:
            res.append(f[0]+sep+f[1])
    return res

# Formats birth :
# mmyy, ddyy, yy, yyyy, ddmm
# In xl : , yymm, yydd, mmdd, ddyyyy, mmyyyy

# Alternates :
# 1,2,3,4,5,6,7,8,9

def date_formats():
    global birth
    if(birth is None or len(birth) == 0 or pool == 's'):
        return []
    b = birth.split('/')
    res = [b[1]+b[2][2:], b[0]+b[2][2:], b[2][2:], b[2], b[0]+b[1]]
    if(pool == 'xl'):
        res = res + [b[2][2:]+b[1], b[2][2:]+b[0], b[1]+b[0], b[0]+b[2], b[1]+b[2]]
    if(pool in ['xl', 'l']):
        res = res + ['1','2','3','4','5','6','7','8','9']
    return res

