def formats():
    global lname
    global usernames
    global separators
    global mail_mode
    res = []
    if(lname is not None and len(lname) > 0):
        res.append(lname)
    for fname in fname_variants():
        for sep in separators:
            if(lname is not None and len(lname) > 0):
                res.append(fname[0]+sep+lname)
                res.append(lname[0]+sep+fname)
                res.append(fname+sep+lname)
                res.append(lname+sep+fname)
                res.append(fname+sep+lname[0])
                res.append(lname+sep+fname[0])
            res.append(fname)
    if(usernames is not None and len(usernames) > 0):
        for u in usernames.split(','):
            res.append(u)
    return res

def main():
    global separators
    global pool
    global mails
    global mail_mode
    dates = date_formats()
    pseudos = formats()
    if(not mail_mode):
        for pseudo in pseudos:
            print(pseudo)
            for date in dates:
                if(pool == 'xl'):
                    for sep in separators:
                        print(pseudo+sep+date)
                else:
                    if('.' in pseudo):
                        print(pseudo+'.'+date)
                    elif('_' in pseudo):
                        print(pseudo+'_'+date)
                    else:
                        print(pseudo+date)
    else:
        with_dates = []
        for pseudo in pseudos:
            with_dates.append(pseudo)
            for date in dates:
                if(pool == 'xl'):
                    for sep in separators:
                        with_dates.append(pseudo+sep+date)
                else:
                    if('.' in pseudo):
                        with_dates.append(pseudo+'.'+date)
                    elif('_' in pseudo):
                        with_dates.append(pseudo+'_'+date)
                    else:
                        with_dates.append(pseudo+date)
        for pseudo in with_dates:
            for mail in mails:
                print(pseudo+"@"+mail)

main()
